import React from "react";
import { NavLink } from "react-router-dom";

export const Menu = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <NavLink to="/Home">Home</NavLink>
          </li>
          <li>
            <NavLink to="/MovieList">Movie List</NavLink>
          </li>
          <li>
            <NavLink to="/Home">Home</NavLink>
          </li>
          <li>
            <NavLink to="/Home">Home</NavLink>
          </li>
        </ul>
      </nav>
      Menu
    </div>
  );
};
